                <div className='imgBx'>
                    <img src={add} className='img-fluid' />
                </div>
                <h2>Teacher Name</h2>
                <h3>Teacher</h3>
                <button className='btn btn-outline-primary'>View Profile</button>
            </div>
            <div className='info'>
                <h2>abc</h2>
                <h2>cde</h2>
                <h2>efc</h2>
            </div>
        </div>
    )
}
